(lib.calibrate_btn = function(mode,startPosition,loop,reversed) {
if (loop == null) { loop = true; }
if (reversed == null) { reversed = false; }
	var props = new Object();
	props.mode = mode;
	props.startPosition = startPosition;
	props.labels = {};
	props.loop = loop;
	props.reversed = reversed;
	cjs.MovieClip.apply(this,[props]);

	// timeline functions:
	this.frame_0 = function() {
		this.stop();
	}
	this.frame_1 = function() {
		this.setSlider = function() {
			//this.calr.y = this.parent.settingCalibrator.starty*1.065;//I don't know why this is needed....
			var target_score = (Math.max(...this.parent.i_score_arr) + 0.025).toFixed(3);
			this.calr.thrsh.text = this.parent.i_score_thresh = target_score;
			var targety = 1.065*(this.parent.settingCalibrator.starty-(target_score*this.parent.settingCalibrator.rangey));
			createjs.Tween.get(this.calr).to({alpha:1,y:targety},1000).call(function() {
				this.messg.gotoAndStop(1);
				this.parent.settingCalibrator.setting = 2;
				console.log('changing to 2');
			}.bind(this));
			
			//createjs.Tween.get(this['ltr_'+this.arrange_btns[i][j]]).to({y:50+this.levels_y[i],x:this.start_x+(j*(this.btns_width/this.btn_row_num)),scale:this.levels_scale[i]},this.btn_move_duration,createjs.Ease.sineOut);
		}
	}

	// actions tween:
	this.timeline.addTween(cjs.Tween.get(this).call(this.frame_0).wait(1).call(this.frame_1).wait(1));

	// Layer_3
	this.dot = new lib.red_dot();
	this.dot.name = "dot";
	this.dot.setTransform(256.15,191.9);

	this.messg = new lib.Calibrationmessages();
	this.messg.name = "messg";
	this.messg.setTransform(203.4,25.9,1,1,0,0,0,192.2,21.5);

	this.timeline.addTween(cjs.Tween.get({}).to({state:[{t:this.dot}]}).to({state:[{t:this.messg}]},1).wait(1));

	// Layer_1
	this.cbt_btn = new lib.calibrate_button();
	this.cbt_btn.name = "cbt_btn";
	this.cbt_btn.setTransform(256,350);

	this.calr = new lib.calibrtr();
	this.calr.name = "calr";
	this.calr.setTransform(256,73.45);
	this.calr.alpha = 0.0117;

	this.timeline.addTween(cjs.Tween.get({}).to({state:[{t:this.cbt_btn}]}).to({state:[{t:this.calr}]},1).wait(1));

	this._renderFirstFrame();

}).prototype = p = new cjs.MovieClip();
p.nominalBounds = new cjs.Rectangle(11.2,4.4,384.5,367.20000000000005);


